import React from "react";
import axios from "axios";
import { View, Text, TouchableOpacity, Modal, WebView, Button, Linking } from "react-native";

export default function Payment() {
  var bodyFormData = new FormData();
  const products = [
    {
      id: 1,
      name: "product 1",
      price: 100,
      quantity: 1
    },
    {
      id: 2,
      name: "product 2",
      price: 10,
      quantity: 2
    }
  ];
  const total = 120;

  bodyFormData.set('products', products);
  bodyFormData.set('total', total);
  function handleClick() {
    axios({
      method: 'post',
      url: 'http://192.168.1.103:5000/paypal',
      data: bodyFormData,
      headers: { 'Content-Type': 'multipart/form-data' }
    })
      .then(function (response) {
        //handle success
        console.log(response);
      })
      .catch(function (response) {
        //handle error
        console.log(response);
      });
    // Linking.openURL('http://192.168.1.103:5000/paypal');
  };
  return (
    <View style={{ marginTop: 100 }}>
      <Button title="Click me" onPress={handleClick} />
    </View>
  );
}
